import './Cadastro.css'
import React, {useState} from 'react';
import { addBox } from '../Redux/boxSlice';
import { useDispatch } from "react-redux";

export default function Cadastro(){

    const [produto, setProduto] = useState();
    const dispatch = useDispatch();

    function handleImputChange(e){
        setProduto({...produto,[e.target.name]: e.target.value});
    }

    function handleSubmit(e){
        e.preventDefault();
        dispatch(addBox(produto))
        // props.setProduto(props.produto.concat(produto));
    }
  
    return (
        <main>
        <div className="container">
            <div className="card" id="borda">
                <div id="Vender">
                    <h1 className='Titulo'>Produtos</h1>
                    <form id="form_produto" className="Add_form">
                        <label>Nome:</label>
                        <input 
                            type="text" 
                            onChange={handleImputChange}     
                            name="nomeProduto" 
                            className="form-control"  
                            placeholder="Nome"
                        />
                        <label>Email:</label>
                        <input 
                            type="text" 
                            onChange={handleImputChange} 
                            name="descProduto" 
                            className="form-control"  
                            placeholder="Descrição do Produto"
                            />
                        <label>Senha:</label>
                        <input 
                            type="number" 
                            onChange={handleImputChange} 
                            name="quantidade" 
                            className="form-control" 
                            placeholder="Defina a quantidade de peças"
                        />
                        <input onClick={handleSubmit} type="submit" value="Anunciar"/>
        
                    </form>
                </div>
            </div>
        </div>
    </main>
    );
}
